import React from 'react'
import { BrowserRouter, Route } from "react-router-dom";
import Home from './pages/Home';

function App() {

  return (
      <BrowserRouter>
        <Route exact path="/" element={<Home />} />
      </BrowserRouter>
  );
}

export default App;
